        protected void GetCrystal(List<(bool On, TranslationCrystal SubCrystal)> ret)
        {
            ret.Add((Stage, null));
            ret.Add((LogEntries?.Overall ?? true, LogEntries?.Specific?.GetCrystal()));
        }
